import React from 'react';
import './Speak4Env.css';
import tree from './tree.svg';

class Speak4Env extends React.Component {
    /**
     * Do your thang here
     */
    render() {
        return (
            <div className="container">
                <div className="jumbotron bg-white mb-0 center">
                    <h1 class="display-7">Speak4Env !</h1>
                    <p class="lead">Speak4Env gives you the opportunity to express and share with others your thoughts and ideas about improving our planet. Let's make it a better place for all of us!</p>
                    <hr class="my-4"/>
                </div>
            </div>
        );
    }
}

export default Speak4Env;
